void PopArtemisRPC::poll()
{
	boost::mutex::scoped_lock lock(poll_mtx);

	PopTimestamp now = get_microsec_system_time();
	now -= last_pps;
	if( led )
	{
		if( now.get_real_secs() > 5 )
		{
			led->set_error(LED_STATUS_PPS_ERROR);
		}
		else
		{
			led->clear_error(LED_STATUS_PPS_ERROR);
		}
	}
}


